import "./Toolbar.css";
import arrow from "../images/arrow.png";

const Toolbar = () => {
  return (
    <>
      <div>
        <div className="toolbar-left">
            <label>Khám phá</label>
           <ul className="list-toolbar">
            <li> 
            <span>Mới nhất</span>
            <img src={arrow} alt=""/>
            </li>
            <li>Sưu tập</li>
            <li>Bình luận</li>
            <li>Khuyến mãi</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Toolbar;
